  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of aerial
  surveys and a ground species identification survey that was conducted on the Nowitna
  National Wildlife Refuge in 1988. Totals of 182 swans and 35 nests were observed
  during the spring survey. Total swans observed increased 21% from 1987, although
  the number of nesting pairs remained the same. A total of 257 swans was observed
  during the fall survey, including 78 juvenile swans in 24 broods. Total swans increased
  37% over 1987, primarily due to increases in paired adults and flocked adults. Cygnet
  production in 1988 was good, with the fall population containing 30% young. Study
  area maps and data forms are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
